import React, { Component } from 'react'
import './Footer.css';
class Footer extends Component {
    render() {
        return (
            <center>
            <div id="footer">
           <p id="footer-copy">&copy; Copyright 2020 -<a href="/">TheQnA.Org</a></p>
            </div>
      
        </center>
            
        )
    }
}

export default Footer
